import React, { Component } from "react";
import Carousel from "../components/Carousel";
import one from "../assets/images/11.jpg";
import two from "../assets/images/22.jpg";
import three from "../assets/images/33.jpg";

class Profile extends Component {
  render() {
    return (
      <div className="container up">
        <div className="card mb-3" style={{ minWidth: "10%" }}>
          <p style={{ textAlign: "center" }}>
            <img
              src="images/1.jpg"
              className="card-img-top"
              alt="..."
              style={{ width: "40%", height: "50%" }}
            />
          </p>
          <div className="card-body">
            <h5 className="card-title" style={{ fontSize: "30px" }}>
              {this.state.product.name}{" "}
              <span style={{ color: "red", fontWeight: "bold" }}>
              </span>
            </h5>
            <p classname="card-text" style={{ fontSize: "16px"}}>{product.description}</p>
            </div>
          </div>
        </div>
    );
  }
}

export default Profile;
